package main

import (
	"sort"
)

func sumOfDigits(n int) int {
	if n < 0 {
		n = -n
	}
	sum := 0
	for n > 0 {
		sum += n % 10
		n /= 10
	}
	return sum
}

func OrderByPoints(nums []int) []int {
	if len(nums) == 0 {
		return []int{}
	}

	// Create a copy to avoid modifying the original
	result := make([]int, len(nums))
	copy(result, nums)

	// Create indices to track original positions
	indices := make([]int, len(nums))
	for i := range indices {
		indices[i] = i
	}

	// Stable sort by digit sum, preserving original order for ties
	sort.SliceStable(indices, func(i, j int) bool {
		sumI := sumOfDigits(result[indices[i]])
		sumJ := sumOfDigits(result[indices[j]])
		return sumI < sumJ
	})

	// Reorder result based on sorted indices
	sorted := make([]int, len(nums))
	for i, idx := range indices {
		sorted[i] = result[idx]
	}

	return sorted
}
